import React from 'react';
import Link from 'next/link';
import './nav.css';

const Nav = () => (
  <header className="page-header">
    <nav>
      <Link href="/">
        <a>Index</a>
      </Link>
      <Link href="/page-two">
        <a>page-two</a>
      </Link>
      <Link href="/page-three">
        <a>page-three</a>
      </Link>
    </nav>
  </header>
);

export default Nav;
